import { memo } from 'react';
import type { FC } from 'react';

import styles from '../_styles.module.css';
import { LogoIcon } from './LogoIcon';
import { AirplaneIcon } from './AirplaneIcon';
import { PhoneIcon } from './PhoneIcon';
import classes from './tour.module.css';
import { Player, Controls } from '@lottiefiles/react-lottie-player';
import $ from 'jquery';
import MultipleItems from './continentscaro';
import MultipleItems2 from './continentscarohotel';
import Section_1TourWelcome from './Section_1TourWelcome';
import Section_2Tags from './Section_2Tags';
import Section_3CityS from './Section_3CityS';
import Section_4Title from './Section_4Title';
import Section_4Title2 from './Section_4Title2';
import Section_4Title3 from './Section_4Title3';
import Section_5Title from './Section_5Title';
import SectionMap from './SectionMap';
import Section_6Title from './Section_6Title';
import FormTitle from './FormTitle'
import Form from './Form';
import SuggestionTitle from './SuggestionTitle'
import Suggestions from './Section_8Suggestions';
import Section_9Footer from './Section_9Footer';
import Day12 from './Day12';
import Day35 from './Day35';


interface Props {
  className?: string;
}

var lottiePlayer = document.getElementsByTagName("lottie");

$(lottiePlayer).on('mouseenter', function(event) {
    console.log(this);
    "this.setDirection(1)"
    "this.play()"

}).on('mouseleave', function(event) {
    "this.setDirection(-1)"
    "this.play()"
});


export const _tour: FC<Props> = memo(function continent(props = {}) {
  return (
    <div className={`${styles.mainStyles} ${classes.root}`}>
      <div>
        <Section_1TourWelcome />
      </div>
      <div>
        <Section_2Tags />
      </div>
      <div>
        <Section_4Title />
        <Day12 />
        <Section_4Title2 />
        <div className={classes.slider}>
        <MultipleItems />
        <Day35 />
        <Section_4Title3 />
        <div className={classes.slider3}>
        <MultipleItems />
        </div>
        </div>
      </div>
      <div>
        <Section_5Title />
        <div className={classes.sliderhotel}>
        <MultipleItems2 />
        <SectionMap />
        </div>
      </div>
      <div>
        <FormTitle />
      </div>
      <div className={classes.form}>
        <Form />
      </div>
      <div>
        <SuggestionTitle />
      </div>
      <div className={classes.suggestions}>
        <Suggestions />
      </div>
      <div>
        <Section_9Footer />
      </div>
      <div className={classes.logo}>
        <LogoIcon className={classes.icon5} />
      </div>
      <div className={classes.createYourDreamTour}>Create your dream tour</div>
      <div className={classes.rectangle152}></div>
      <div className={classes.airplane}>
        <AirplaneIcon className={classes.icon6} />
      </div>
      <div className={classes.rectangle153}></div>
      <div className={classes.continent}>+</div>
      <div className={classes.destinations}>Destinations</div>
      <div className={classes.rectangle154}></div>
      <div className={classes.continent2}>+</div>
      <div className={classes.rentals}>Rentals</div>
      <div className={classes.rectangle155}></div>
      <div className={classes.continent3}>+</div>
      <div className={classes.typeOfTrips}>
        <p className={classes.labelWrapper11}>
          <span className={classes.label25}>type </span>
          <span className={classes.label26}>of trips</span>
        </p>
      </div>
      <div className={classes.meetGreetServices}>Meet + Greet Services</div>
      <div className={classes.rectangle156}></div>
      <div className={classes.phoneCall}>
        <PhoneIcon className={classes.icon7} />
      </div>
      <div className={classes.rectangle157}>
      </div>
      <div className={classes.email}>
      </div>
      <div className={classes.rectangle158}>
      </div>
      <div className={classes.eng}></div>
    </div>
  );
});
